import React from 'react';
import './css.css'
import Etusivu from './components/Etusivu'
import Harrastajat from './components/Harrastajat'
import Ammattilaiset from './components/Ammattilaiset'
import OmatTreenit from './components/OmatTreenit'
import {BrowserRouter as Router, Route, Link} from 'react-router-dom' //Applikaation sivuille

import { makeStyles } from '@material-ui/core/styles';
import Paper from '@material-ui/core/Paper';
import Tabs from '@material-ui/core/Tabs';
import Tab from '@material-ui/core/Tab';


const App = () => {
  const useStyles = makeStyles({
    root: {
      flexGrow: 1,
    },
  });
  
  function CenteredTabs() {
    const classes = useStyles();
    const [value, setValue] = React.useState(0);
  
    const handleChange = (event, newValue) => {
      setValue(newValue);
    };
  
    return (
      <Paper className={classes.root}>
        <Tabs
          value={value}
          onChange={handleChange}
          indicatorColor="primary"
          textColor="primary"
          centered
        >
          <Tab label="Item One" />
          <Tab label="Item Two" />
          <Tab label="Item Three" />
        </Tabs>
      </Paper>
    );
  } 

  return (
    <div>
      <h1>
          TREENIPÄIVÄKIRJA
        </h1>
        <h6>
          Harjoitus 4, created by Jenni Lehtonen
        </h6>
        {CenteredTabs}
      <Router>
        <main>
          <nav>
              <button><Link to='/'>Etusivu</Link></button>
              <button><Link to='/harrastajat'>Harrastajat</Link></button>
              <button><Link to='ammattilaiset'>Ammattilaiset</Link></button>
              <button><Link to='/Omattreenit'>Omat treenit</Link></button>
          </nav>
          <Route exact path="/" component={Etusivu} />
          <Route exact path="/harrastajat" component={Harrastajat} />
          <Route exact path="/ammattilaiset" component={Ammattilaiset} />
          <Route exact path="/omattreenit" component={OmatTreenit} />
        </main>
      </Router>

    </div>
  );
}

export default App;
